<!DOCTYPE html>
<html lang="EN">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width">

    <title>Parallax</title>
    <style>
        svg { 
            transform-box: fill-box;
        }
        
        /* .celest {
            animation-name: celestial-rise;
            animation-duration: 4s;
            animation-timing-function: linear;
            animation-iteration-count: 1;
            animation-delay: 3s;
            animation-direction: normal;
            animation-fill-mode: forwards;
            transform-origin: 154px 101px;
        } */
        
        .twinkle {
            opacity: 0%;
            animation-name: star-rise;
            animation-duration: 4s;
            animation-timing-function: ease-in-out;
            animation-iteration-count: 1;
            animation-delay: 3s;
            animation-direction: normal;
            animation-fill-mode: forwards;
        }
        
        .sun{
            transform-origin: center;
            animation: celestial 4s linear 3s infinite normal forwards;
        }
        
        .moon{
            transform-origin: center;
            animation: celestial 4s linear 3s infinite normal forwards;
        }
        
        .terrestrial {
            position: absolute;
            top: -200px;
        }
        
        .mountain{
            animation: mountain-slide 100s linear infinite forwards;
        }
        
        .hills{
            animation: hills-slide 25s linear infinite forwards;
            background: linear-gradient(rgba(0,0,255, .0), 30%, rgba(0,0,128, .8));
        }
        
        .desert{
            animation: road-slide 2s linear infinite forwards;
            background: linear-gradient(rgba(0,0,255, .0), 15%, rgba(0,0,128, .8));
        }
        .skyBack{
            animation: cloud 20s linear infinite forwards;
        }
        
        .skyFront{
            animation: cloud 10s linear infinite forwards;
        }
        
        @keyframes mountain-slide {
            to {
                transform: translateX(-35%);
            }
        }
        
        @keyframes hills-slide {
            to {
                transform: translateX(-198%);
            }
        }
        
        @keyframes road-slide {
            to {
                transform: translateX(-259%);
            }
        }
        
        @keyframes celestial {
            to {
                transform: rotate(360deg);
            }
        }
        
        @keyframes star-rise {
            to {
                opacity: 100%;
            }
        }
        
        @keyframes cloud {
            to {
                transform: translateX(-200%);
            }
        }
        
        
    </style>
</head>

    <script>
        //https://css-tricks.com/get-value-of-css-rotation-through-javascript/ reference


document.addEventListener("DOMContentLoaded", () => {
    document.querySelector('.celest').onclick = async () => {
        const doAnimation = async () => {
            const skybox = document.querySelector('.celest')
            const stars = document.querySelector('.twinkle')
            //Where are we rotated?  Apparently the method for doing so involves parsing a string from
            //computed css styles.

            var values = window.getComputedStyle(skybox).getPropertyValue("transform").split('(')[1],
                values = values.split(')')[0],
                values = values.split(',');
            
            const angle = Math.round(Math.atan2(values[1], values[0]) * (180/Math.PI))
            console.log(angle)
            const to = angle 
            const from = to + 180

            const skyAnim = skybox.animate([
                { transform: 'rotate(' + to.toString() + 'deg)' },
                { transform: 'rotate(' + from.toString() + 'deg)' }
              ], {
                duration: 5000,
                fill: 'forwards',
                direction: 'normal'
              })
              const opacity = parseInt(window.getComputedStyle(stars).getPropertyValue("opacity"))
            const starAnim = stars.animate([
                { opacity: opacity},
                { opacity: opacity === 1 ? .35 : .65},
                { opacity: opacity === 1 ? 0 : 1}],
                {duration: 5000, direction: 'normal', fill:"forwards"})
            const effect = async () => {
                starAnim.play()
                skyAnim.play()
            }
            const end = await effect()
        } 
        await doAnimation()
    }
})
    </script>
